import { Container } from './styles';
import PropTypes from 'prop-types';

export default function FormGroup({ children }) {
  return (
  <Container>
    {children}
    
     </Container>
  )
}

FormGroup.propTypes = {
  children: PropTypes.node.isRequired,
  error: PropTypes.string,
};

FormGroup.defaultProps = {
  error: null,
};
